import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Switch>
          <div>ABC</div>
        </Switch>

      </Router>
    </>
  );
}

export default App;
